import { useState } from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Offcanvas from "react-bootstrap/Offcanvas";
import { useNavigate } from "react-router-dom";
import img from "../img/freely-logo-final.png";

const AppNavBar = () => {

  const navigate = useNavigate()
  const[navTop, setnavTop]=useState(false)

  function scrollHandler(){
    if (window.scrollY > 100)
    {
      setnavTop(true)

    }else{
      setnavTop(false)

    }

  }
  window.addEventListener("scroll",scrollHandler)

  return (
    <div>
      <>
        {["sm"].map((expand) => (
          <Navbar key={expand} expand={expand} className={navTop?"mb-3 navbar fixed-top navcolor navShadow":"mb-3 navbar fixed-top navcolor"}>
            <Container>
              {/* <Navbar.Brand >NavItems</Navbar.Brand> */}
              <Navbar.Brand>
                <a href="" onClick={()=>navigate("/")}><img src={img} alt="logo" className="logoImg" /></a>
              </Navbar.Brand>
              <Navbar.Toggle
                aria-controls={`offcanvasNavbar-expand-${expand}`}
              />
              <Navbar.Offcanvas
                id={`offcanvasNavbar-expand-${expand}`}
                aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
                placement="end"
              >
                <Offcanvas.Header closeButton>
                </Offcanvas.Header>
                <Offcanvas.Body>
                  <Nav className="justify-content-end flex-grow-1 pe-3 navLink">
                    <Nav.Link onClick={() =>{
                        navigate("/")
                    } }>
                      Home
                    </Nav.Link>
                    <Nav.Link onClick={() =>{
                         navigate("/")
                    } }>
                      About Us
                    </Nav.Link>
                    <Nav.Link onClick={() =>{
                         navigate("/")
                    } }>
                      FAQ's
                    </Nav.Link>
                    <Nav.Link onClick={() =>{
                         navigate("/")
                    } }>
                      Blog
                    </Nav.Link>

                  </Nav>
                </Offcanvas.Body>
              </Navbar.Offcanvas>
            </Container>
          </Navbar>
        ))}
      </>
    </div>
  );
};

export default AppNavBar;
